import React from 'react';
import subject1 from './res/subject1.png';
import subject2 from './res/subject2.png';
import subject3 from './res/subject3.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div style={{height: 200, width: 200}}>
          <img styles={{height: 200, width: 200}} source={subject1} alt='subject' />
        </div>
        <div style={{height: 200, width: 200}}>
          <img source={subject2} alt='subject' />
        </div>
        <div style={{height: 200, width: 200}}>
          <img source={subject3} alt='subject' />
        </div>
      </header>
    </div>
  );
}

export default App;
